import React, { useState } from 'react';
import './App.css';
function App() {
  const [search,setSerch]=useState('');
  const handleinput=(e)=>{
    setSerch(e.target.value)
  }
  return (
    <div className='App'>
      <input type="text" value={search} onChange={handleinput}/>
     <br/>
     <button>click</button>
    </div>
  )
}
export default App
